        align-items: center;
        column-gap: 0.8em;
        background-color: transparent;
        backdrop-filter: blur(200px);
        z-index: 1;
        transition: linear 1s;
    }

    nav[hidden] {
        opacity: 0;
        transition: none;
    }

    nav a {
        color: white;
    }

    section {
        padding: 100px;
        width: 100%;
        height: 100vh;
    }
</style>

<body>
    <header>
        <h1>标题</h1>
        <h2>副标题</h2>
        <p>
            <a class="to1">看内容1</a>
        </p>
        <p>
            <a class="to2">看内容2</a>
        </p>
    </header>
    <div id="header-placeholder"></div>
    <nav hidden>
        <div class="content">
            <a href="#1">看内容1</a>
            <a href="#2">看内容2</a>
            <a href="#header-placeholder">回顶部</a>
        </div>
    </nav>
    <div class="content-bg">
        <div class="content">
            <section id="1">
                <h1>标题1</h1>
                <p>内容1</p>
            </section>
            <section id="2">
                <h1>标题2</h1>
                <p>内容2</p>
            </section>
        </div>
    </div>
</body>
<script>
    const ob = new IntersectionObserver(([e]) => {
        if (e.intersectionRatio === 1) {
            document.getElementsByTagName('nav')[0].setAttribute('hidden', '1')
        } else {
            document.getElementsByTagName('nav')[0].removeAttribute('hidden')
        }
    }, {
        threshold: [1]
    })

    ob.observe(document.getElementsByTagName('nav')[0])
</script>

</html>
